import React from 'react';
import heroImage from '../../assets/hero-image.png';

const Home = () => {
  return (
    <div className="mx-auto px-6 md:px-20 xxl:px-0" style={{ maxWidth: '1550px' }}>
      <div
        className="flex justify-around w-full text-base relative"
        style={{ backgroundColor: '#C4B682' }}>
        <div className="w-1/2">
          <img src={heroImage} alt="" className="w-full" style={{ maxWidth: '425px' }} />
        </div>
        <div className="w-1/2 grid place-items-center">
          <div>
            <h1 className="font-semibold text-5xl leading-tight max-w-96 mb-5">
              Where Beauty Meets Luxury -<br />
              <span className="text-white">Sugar&apos;d Bare</span>
            </h1>
            <p className="max-w-96">
              Indulge in expert sugaring and top-tier beauty services, all delivered with a warm and
              welcoming touch.
            </p>
            <a href="#" className="underline">
              <p className="text-xs font-semibold text-center pt-12">View Services</p>
              {/* add animation to make button bounce */}
              <button>arrow</button>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
